import React, { useState, useEffect } from 'react';
import { Link } from 'react-router-dom';
import axios from 'axios';
import '../styles/SubmittedCodesPage.css';

function SubmittedCodesPage() {
  const [codes, setCodes] = useState([]);

  useEffect(() => {
    const fetchCodes = async () => {
      try {
        const response = await axios.get('http://localhost:5001/api/codes');
        setCodes(response.data);
      } catch (error) {
        console.error('Error fetching codes', error);
      }
    };

    fetchCodes();
  }, []);

  return (
    <div className="submitted-codes-container">
      <h1>Submitted Codes</h1>
      <ul>
        {codes.map((code) => (
          <li key={code._id}>
            <Link to={`/view-comments/${code._id}`}>{code.title}</Link>
          </li>
        ))}
      </ul>
    </div>
  );
}

export default SubmittedCodesPage;
